import React from "react";
import {
  AppBar, Toolbar, Typography, IconButton, Avatar, Box, Card, Divider, Button, Badge
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import PersonIcon from "@mui/icons-material/Person";

// Nav bar links (no dropdowns)
const navLinks = [
  { label: "Home", link: "#" },
  { label: "Order", link: "#" },
  { label: "Reports", link: "#" },
  { label: "Customer Service", link: "#" },
];

export default function FuelNowDashboard() {
  return (
    <Box className="zomato-dashboard-container">
      {/* Zomato-style Navbar */}
      <AppBar position="static" sx={{ bgcolor: "#e23744", width: "100vw", px: 0, boxShadow: 1 }}>
        <Toolbar sx={{
          width: "100%",
          minHeight: 56,
          px: { xs: 2, md: 8 },
          display: "flex",
          justifyContent: "space-between"
        }}>
          {/* Branding */}
          <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
            <Avatar sx={{
              width: 34, height: 34, bgcolor: "#fff", color: "#e23744", fontWeight: 900
            }}>
              <PersonIcon />
            </Avatar>
            <Typography
              variant="h6"
              fontWeight={900}
              sx={{ letterSpacing: 1.5, color: "#fff", fontSize: 21 }}
            >
              FUELnow
            </Typography>
          </Box>
          <Box sx={{
            flex: 1, display: "flex", justifyContent: "center", gap: { xs: 1, md: 2 }
          }}>
            {navLinks.map(item => (
              <Button
                key={item.label}
                href={item.link}
                sx={{
                  color: "#fff", fontWeight: 700,
                  fontSize: 15,
                  textTransform: "none",
                  "&:hover": { color: "#ffd1d1" }
                }}>
                {item.label}
              </Button>
            ))}
          </Box>
          <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
            <IconButton size="large" sx={{ color: "#fff" }}>
              <Badge badgeContent={0} color="error">
                <ShoppingCartIcon sx={{ fontSize: 22 }} />
              </Badge>
            </IconButton>
            <IconButton sx={{ p: 0 }}>
              <Avatar sx={{
                width: 32, height: 32,
                bgcolor: "#ffd1d1", color: "#b71c1c",
                fontWeight: 700, fontSize: 17
              }}>
                J
              </Avatar>
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>

      {/* MAIN CONTENT - Compact Area */}
      <Box className="zomato-main-card-area">
        <Box sx={{
          display: "flex",
          gap: 2,
          width: "100%",
          flexWrap: "wrap",
          justifyContent: "stretch"
        }}>
          <Card sx={{
            flex: 1, minWidth: 220, maxWidth: 260, p: 2, borderRadius: 2, boxShadow: 1,
            bgcolor: "linear-gradient(135deg, #f44336 0%, #e57373 100%)", background: "linear-gradient(135deg, #f44336 0%, #e57373 100%)"
          }}>
            <Typography fontWeight={750} color="#fff" sx={{
              fontSize: 14, mb: 0.5
            }}>AVAILABLE LOYALTY</Typography>
            <Typography variant="h5" color="#fff" fontWeight={900}>₹0</Typography>
            <Typography color="#fff" fontSize={13}>
              Available Loyalty - Blocked(In Cart, Payment Initiated)
            </Typography>
          </Card>
          <Card sx={{
            flex: 1, minWidth: 220, maxWidth: 260, p: 2, borderRadius: 2, boxShadow: 1,
            bgcolor: "linear-gradient(135deg, #ffb300 0%, #ffe082 100%)", background: "linear-gradient(135deg, #ffb300 0%, #ffe082 100%)"
          }}>
            <Typography fontWeight={750} color="#fff" sx={{
              fontSize: 14, mb: 0.5
            }}>MY WALLET LIMIT</Typography>
            <Typography variant="h5" color="#fff" fontWeight={900}>₹0</Typography>
            <Typography color="#fff" fontSize={13}>
              Amount available in your wallet
            </Typography>
          </Card>
          <Card sx={{
            flex: 1, minWidth: 220, maxWidth: 260, p: 2, borderRadius: 2, boxShadow: 1,
            bgcolor: "#fff"
          }}>
            <Typography fontWeight={750} color="#e23744" sx={{
              fontSize: 15, mb: 1
            }}>My Last 5 Orders</Typography>
            <Divider sx={{ my: 1 }} />
            <Typography fontSize={13} color="#222" sx={{ opacity: 0.7 }}>No records found</Typography>
          </Card>
        </Box>

        {/* My Assets - small, clean */}
        <Card sx={{
          mt: 3, p: 2, borderRadius: 2, boxShadow: 1,
          bgcolor: "#fff"
        }}>
          <Box display="flex" justifyContent="space-between" alignItems="center" mb={1}>
            <Typography fontWeight={800} color="#e23744">
              My Assets
            </Typography>
          </Box>
          <Divider sx={{ mb: 1 }} />
          <Typography color="#444" fontSize={13}>
            No records found
          </Typography>
        </Card>
      </Box>
    </Box>
  );
}
